import React from 'react';
import './App.css';
import Header from './Header';
import Home from './Home'
import {BrowserRouter as Router,Swich,Route} from 'react-router-dom';


function App() {
  return (
    <div className="app">
<Router>
  <Switch>
    <Route path="/checkout">
    <Header/>
    <h1>Hey Iam Checkout</h1>
    </Route>


    <Route path="/">
    <Header/>
    <Home/>
    </Route>
    </Switch>
</Router>


    </div>
  );
}

export default App;
